import React from "react";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import SearchKakaoMap from "./components/kakao/SearchKakaoMap";
import TypeNaverMap from "./components/naver/TypeNaverMap";
import SearchNaverMap from "./components/naver/SearchNaverMap";

const App = () => (

    <Router>
        <Routes>
            <Route path={`${process.env.PUBLIC_URL}/`} exact element={<SearchKakaoMap />}></Route>
            <Route path={`${process.env.PUBLIC_URL}/searchNaverMap`} element={<SearchNaverMap />}></Route>
            <Route path={`${process.env.PUBLIC_URL}/typeNaverMap`} element={<TypeNaverMap />}></Route>
        </Routes>
    </Router>
);

export default App;
